    \begin{tikzpicture}[node distance=1cm]
    % Define colors
    \definecolor{myblue}{RGB}{173,216,230}
    \definecolor{mygreen}{RGB}{144,238,144}

    % Text-based description section
    \node[draw, fill=myblue, rounded corners, text width=5cm] (desc1) {Text-based description of the random number generator. This section provides a clear understanding of its structure and function.};

    % Visual representation section
    \node[draw, fill=mygreen, rounded corners, below=of desc1, text width=5cm] (visual) {Visual representation of the generator. Components are labeled and arrows indicate relationships.};

    % Text-based description of visual representation section
    \node[draw, fill=white, rounded corners, below=of visual, text width=5cm] (desc2) {Text-based description of the visual representation, clarifying details and enhancing understanding.};

    % Arrows between sections
    \draw[->] (desc1.south) -- (visual.north);
    \draw[->] (visual.south) -- (desc2.north);

    % Visual representation components
    \node[draw, fill=white, below=of visual, xshift=-3cm, text width=2cm] (comp1) {Component 1};
    \node[draw, fill=white, below=of visual, xshift=0cm, text width=2cm] (comp2) {Component 2};
    \node[draw, fill=white, below=of visual, xshift=3cm, text width=2cm] (comp3) {Component 3};

    % Arrows between components
    \draw[->] (comp1.east) -- (comp2.west);
    \draw[->] (comp2.east) -- (comp3.west);
\end{tikzpicture}
    \end{document}

