    % Arrows indicating relationships
    \draw[->] (0.5, -0.5) -- (4.5, -0.5) node[midway, above] {Relationship};
    \draw[->] (0, -1) -- (0, -2) node[midway, left] {Flow of information};
    \draw[->] (5, -1) -- (5, -1.5) node[midway, right] {Related concept};

    % Additional symbols
    \node at (2.5, 2) {$\sum$};
    \node at (2, 1) {$\int$};
    \node at (3, 1) {$\prod$};
    \node at (1, 1) {$\sqrt{}$};
    \node at (4, 2) {$\infty$};
