\documentclass[tikz,border=10pt]{standalone}
    \usepackage{tikz}
    \usetikzlibrary{arrows.meta, positioning, shapes.geometric}

    \begin{document}
    \begin{tikzpicture}[scale=3, background color=black]
    % Define the vertices of the tetrahedron
    \coordinate (A) at (1, 1, 1);
    \coordinate (B) at (1, -1, -1);
    \coordinate (C) at (-1, 1, -1);
    \coordinate (D) at (-1, -1, 1);

    % Draw the tetrahedron faces
    \fill[cyan, opacity=0.5] (A) -- (B) -- (C) -- cycle; % ABC
    \fill[magenta, opacity=0.5] (A) -- (B) -- (D) -- cycle; % ABD
    \fill[yellow, opacity=0.5] (A) -- (C) -- (D) -- cycle; % ACD
    \fill[green, opacity=0.5] (B) -- (C) -- (D) -- cycle; % BCD

    % Draw the edges of the tetrahedron
    \draw[white] (A) -- (B);
    \draw[white] (A) -- (C);
    \draw[white] (A) -- (D);
    \draw[white] (B) -- (C);
    \draw[white] (B) -- (D);
    \draw[white] (C) -- (D);

    % Draw the dots at the vertices
    \foreach \point in {A, B, C, D} {
        \fill[red] (\point) circle (0.05);
    }

    % Draw additional dots along the edges
    \foreach \point in {A, B, C, D} {
        \foreach \other in {A, B, C, D} {
            \ifnum\point<\other
                \fill[white] ({(\point) + (\other) / 2}) circle (0.02);
            \fi
        }
    }
\end{tikzpicture}
    \end{document}

