        \foreach \y in {1, 1.5, 2} {
            \fill[white] (\x, \y) rectangle (\x+0.2, \y+0.4);
        }
    }

    \foreach \x in {4.6, 4.8, 5.0, 5.2, 5.4} {
        \foreach \y in {1, 1.5, 2, 2.5, 3, 4} {
            \fill[white] (\x, \y) rectangle (\x+0.2, \y+0.4);
